import { useEffect, useState } from "react";

function AdminDashboard() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const token = localStorage.getItem("token");

  useEffect(() => {
    fetch("http://localhost:4000/api/admin/orders", {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => res.json())
      .then((data) => {
        if (Array.isArray(data)) {
          setOrders(data);
        } else {
          setOrders([]);
        }
        setLoading(false);
      })
      .catch((err) => {
        console.error("Admin fetch error:", err);
        setLoading(false);
      });
  }, [token]);

  if (loading) return <div className="container mt-4">Loading...</div>;

  return (
    <div className="container mt-5">
      <h2 className="fw-bold mb-4 text-center">üì¶ Orders Dashboard</h2>
      {orders.length === 0 ? (
        <p className="text-center text-muted">No orders found ‚ùå</p>
      ) : (
        <div className="table-responsive shadow-sm rounded">
          <table className="table table-striped table-hover align-middle">
            <thead className="table-dark">
              <tr>
                <th>#</th>
                <th>Customer</th>
                <th>Contact</th>
                <th>Address</th>
                <th>Products</th>
                <th>Total</th>
                <th>Session ID</th>
                <th>Date</th>
              </tr>
            </thead>
            <tbody>
              {orders.map((o, index) => (
                <tr key={o._id}>
                  <td className="fw-bold">{index + 1}</td>
                  <td>
                    <div>
                      <span className="fw-bold">{o.customerName}</span>
                      <br />
                      <small className="text-muted">{o.customerEmail}</small>
                    </div>
                  </td>
                  <td>
                    <span className="badge bg-info text-dark">
                      {o.customerPhone}
                    </span>
                  </td>
                  <td style={{ fontSize: "14px" }}>
                    {o.customerAddress?.line1}, {o.customerAddress?.city},{" "}
                    {o.customerAddress?.state} -{" "}
                    {o.customerAddress?.postal_code}
                    <br />
                    <small className="text-muted">
                      {o.customerAddress?.country}
                    </small>
                  </td>
                  <td>
                    {Array.isArray(o.items) &&
                      o.items.map((p, i) => (
                        <div key={i}>
                          <span className="badge bg-secondary me-1">
                            {p.name} (x{p.quantity})
                          </span>
                        </div>
                      ))}
                  </td>
                  <td className="fw-bold text-success fs-6">
                    ‚Çπ{o.totalAmount}
                  </td>
                  <td style={{ fontSize: "12px", wordBreak: "break-word" }}>
                    {o.stripeSessionId}
                  </td>
                  <td>
                    <small className="text-muted">
                      {new Date(o.createdAt).toLocaleString()}
                    </small>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default AdminDashboard;
